import{_ as e,e as t}from"./app.5490a56a.js";const a={},o=t('<h1 id="requirements" tabindex="-1"><a class="header-anchor" href="#requirements" aria-hidden="true">#</a> Requirements</h1><p>To use this starter dashboard, you need:</p><ul><li><p><strong>IBM Z OMEGAMON Data Provider</strong> (ODP)</p></li><li><p><strong>Prometheus</strong><br> The starter was developed and tested in Prometheus <strong>2.22.0</strong>.</p></li><li><p><strong>Grafana</strong><br> The starter was developed and tested in Grafana <strong>8.1.1</strong>.</p></li></ul><h2 id="omegamon-monitoring-agents" tabindex="-1"><a class="header-anchor" href="#omegamon-monitoring-agents" aria-hidden="true">#</a> OMEGAMON monitoring agents</h2><p>The starter dashboard uses data from the OMEGAMON z/OS agent.</p><h2 id="what-you-need-to-know" tabindex="-1"><a class="header-anchor" href="#what-you-need-to-know" aria-hidden="true">#</a> What you need to know</h2><p>To install the starter dashboard, you need to know how to configure Prometheus and Grafana.</p><p>To forward data to the starter dashboard, you need to know how to configure the following OMEGAMON software on z/OS:</p><ul><li>Runtime environments (RTEs)</li><li>Historical data collection</li><li>OMEGAMON Data Provider (ODP)</li></ul><p>To use the starter dashboard, you need to know how to use Grafana, and you need to understand the OMEGAMON attributes shown in the dashboard.</p>',10);function r(n,s){return o}var i=e(a,[["render",r]]);export{i as default};
